svg.script:
const svgns = "http://www.w3.org/2000/svg";
const hoverables = document.getElementsByClassName("hoverable");
for (let h of hoverables) {
    const box = h.getBBox();
    const c = {x: (box.x+box.width/2), y: (box.y+box.height/2)};
    h.style.transformOrigin = c.x+"px "+c.y+"px";
    const screen = document.createElementNS(svgns, "ellipse");
    screen.setAttribute("cx", c.x);
    screen.setAttribute("cy", c.y);
    screen.setAttribute("rx", box.width/2);
    screen.setAttribute("ry", box.height/2);
    screen.setAttribute("opacity", "0");
    const anim = document.createElementNS(svgns, "animateTransform");
    anim.setAttribute("attributeName", "transform");
    anim.setAttribute("attributeType", "XML");
    anim.setAttribute("class", "shudder");
    anim.setAttribute("type", "rotate");
    anim.setAttribute("values", "0; -10; 10; -7; 5; -4; 3; -2; 1; 0;");
    anim.setAttribute("repeatCount", "1");
    anim.setAttribute("dur", "2s");
    //anim.setAttribute("calcMode", "ease");
    h.appendChild(anim);
    h.appendChild(screen);
    console.log(h, anim);
}
setInterval(function () {
    const shudder = document.getElementsByClassName("shudder");
    for (let s of shudder)
        if (Math.random() > .98) {
            s.beginElement();
            break;
        }
}, 1000);
